CREATE TABLE IF NOT EXISTS Data_Kost (
    `nama_kost` VARCHAR(63) CHARACTER SET utf8,
    `alamat` VARCHAR(207) CHARACTER SET utf8,
    `daerah` VARCHAR(41) CHARACTER SET utf8,
    `kecamatan` VARCHAR(20) CHARACTER SET utf8,
    `kota` VARCHAR(22) CHARACTER SET utf8,
    `latitude` NUMERIC(18, 16),
    `longitude` NUMERIC(17, 14),
    `tipe_kost` VARCHAR(11) CHARACTER SET utf8,
    `tipe_kamar` VARCHAR(42) CHARACTER SET utf8,
    `luas_kamar` NUMERIC(18, 16),
    `fasilits_kamar` VARCHAR(52) CHARACTER SET utf8,
    `fasilitas_kamar_mandi` VARCHAR(57) CHARACTER SET utf8,
    `isKamarMandiDalam` VARCHAR(5) CHARACTER SET utf8,
    `fasilitas_gedung` VARCHAR(111) CHARACTER SET utf8,
    `harga_per_bulan` INT
);
